장남(장녀) 장남(녀)이니까 그러면 안돼!
 장남(녀)은 이런거 할줄 알아야해!
 장남(녀)이 해야지!
 장남(녀)은 우리집 대들보지!
 장남(녀)이야? 근데 왜그래?
 장남(녀)은 안그러던데...!
 장남(녀)이니까 니가 해라!
 장남(녀)이야 그럼 잘하겠네!

장남(녀)은 사람입니다. 
장남(녀)은 못할수도 잘할수도 힘들수도 지칠수도 괴로울수도 공통스러울수도 있습니다.

장남(녀)은 버티려고 버티는게 아닐지 모릅니다.
그가 버티지 않으면 모든게 사라질까 겁이 나 버티는지 모릅니다.

대한민국 장남(녀) 화이팅

당신은 혼자가 아닙니다.
당신에겐 남매가 있어요.
당신이 혼자라고 생각말아요.

